import React from 'react';
import Logo from '../data/logo.png';
<svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="w-6 h-6">
  <path stroke-linecap="round" stroke-linejoin="round" d="m21 21-5.197-5.197m0 0A7.5 7.5 0 1 0 5.196 5.196a7.5 7.5 0 0 0 10.607 10.607Z" />
</svg>


const SimplePage = () => {
  return (
    <div className='mx-10'>
      <img src={Logo} />
      <ul>
      <li className="text-black">Services</li>
        <li className="text-black">Technology</li>
        <li className="text-black">Lab</li>
        <li className="text-black">Case Studies</li>
        <li className="text-black">Events/Resources</li>
        <li className="text-black">FAQs</li>
        <li className="text-black">About Us</li>
        <li className="text-black">Blog</li>
      </ul>
    </div>
  );
};

export default SimplePage;
